import { createApp } from 'vue';
import App from './App.vue';
import MonComposant from './components/MyTest.vue';

const app = createApp(App);

// Enregistrer le composant globalement
app.component('mon-composant', MonComposant);
app.component('mon-composant', MonComposant);
app.mount('#app');
